    //Geofence ID
    string id = 4;
  }
  message GeofencePolygonal {
    //Latitude value array
    repeated float lat = 1;
    //Longitude value array
    repeated float lng = 2;
    //Geofence ID
    string id = 3;
  }
  //Circular geofence array
  repeated GeofenceCircular circulars = 1;
  //Polygonal geofence array
  repeated GeofencePolygonal polygonals = 2;
  //Page token
  string pageToken = 3;
}

